const getAnimation = (icon) => {
  switch(icon) {
    case 'certificateIcon':
      return Pharma_Certification
    case 'subzeroIcon':
      return Pharma_Sub_Zero_Area
    case 'acceptanceIcon':
      return Pharma_Acceptance_Area
    case 'barcodeIcon':
      return General_Handling_Codes
    case 'stationsIcon':
      return Pharma_Handling
    case 'sensorsIcon':
      return Pharma_Temperature_Sensors
    case 'partnerIcon':
      return Pharma_Trusted_Partner
    case 'acceptance5' :
      return Acceptance_Shipment_Scan
    case 'acceptance4' :
      return Acceptance_Peak_Hours
    case 'acceptance2' :
      return Acceptance_Info_Checks
    case 'acceptance3' :
      return Acceptance_Contextual_Information
    case 'acceptance1' :
      return Acceptance_Forklift_Route
    case 'acceptance6' :
      return Acceptance_Truck_Arrivals
    case 'general1':
      return General_Pallet_Building
    case 'general4':
      return General_Shipment_Transfers
    case 'general2':
      return General_Emission_Free
    case 'general5':
      return General_Growing_Business
    case 'general6':
      return General_Hub_Transfers
    case 'perishables3':
      return Perishables_Control_Chain
    case 'perishables1':
      return Perishables_Customized_Shipping
    case 'perishables2':
      return Perishables_Time_Critical
    case 'perishables4':
      return Perishables_Precise_Handling
    case 'perishables5':
      return Perishables_Leading_Carrier
    case 'e2e-visibility':
      return Control_End_To_End
    case 'pallet-handling':
      return Control_Pallet_Handling
    case 'disruption-management':
      return Control_Disruption_Management
    case 'iot-monitoring':
      return Control_Live_IOT
    case 'ground-transport':
      return Control_Ground_Transport
    case 'bottlenecks':
      return Control_Bottlenecks
    case 'specialCargoIcon':
      return Tarmac_Tailored_Process
    case 'uldIcon':
      return Tarmac_Optimized_ULD
    case 'winterIcon':
      return Tarmac_Winter_Operations
    case 'networkIcon':
      return Tarmac_Global_Network
    case 'shortDistanceIcon':
      return Tarmac_Short_Transfer
    case 'worldClassIcon':
      return Tarmac_World_Class
  }
}

export function getHotspotMarkup(spot) {
  let icon = getIcon(spot.icon)

  const animation = getAnimation(spot.icon)
  if(animation) {
    const defaultOptions = {
      loop: true,
      autoplay: true,
      animationData: animation,
      rendererSettings: {
        preserveAspectRatio: 'xMidYMid slice'
      }
    }

    icon = <Lottie options={defaultOptions} />
  }

  const markup = (
    <a data-spotid={spot.id} id={spot.id}>
      <div className="Hotspot">
        <div className="icon">
          {icon}
        </div>
        <div className="title" dangerouslySetInnerHTML={{__html:getTitle(spot)}} />
      </div>
    </a>
  )
  return markup
}

const getTitle = (spot) => {
  const content = Content.hotspots.filter((hotspot) => {
    return hotspot.id === spot.id
  })[0]

  if(content) {
    return content.title
    // Good for debugging icons
    //return content.title + ' - ' + spot.icon
  }

  return 'No title'
}

